import React, { Fragment } from "react";
import {
  Container,
  Card,
  Form,
  FormLabel,
  Row,
  Col,
  Button,
  FormCheck,
  FormGroup,
  FormSelect,
  FormControl,
} from "react-bootstrap";
const Studs = () => {
  return (
    <Container>
      <Row className="text-center">
        <h1>LISTADO DE STUDS</h1>
      </Row>

      <Row className="row justify-content-center row-cols-2">
        <Col className="align-items-right col-auto bg-primary opacity-50">
          <input></input>
          <button className="btn">BUSCAR</button>
        </Col>
        
        <Col className="col-auto">
        <button className="btn">AGREGAR STUD</button>
        </Col>
      </Row>
    </Container>
  );
};

export default Studs;
